import { useState } from "react";
import { useNavigate, useSearchParams } from "react-router-dom";

const Register = () => {
  const [searchParams] = useSearchParams();
  const step = parseInt(searchParams.get("step")) || 1;
  const navigate = useNavigate();

  // Store registration details
  const [formData, setFormData] = useState({
    name: "",
    shortname: "",
    address: "",
    number_of_members: "",
    contact: "",
    mission: "",
    vision: "",
    files: null,
  });

  const handleNext = () => navigate(`/register?step=${step + 1}`);
  const handlePrev = () => navigate(`/register?step=${step - 1}`);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  return (
    <div className="register">
      {step === 1 && (
        <div>
          <h2>Step 1: Basic Information</h2>
          <input type="text" name="name" placeholder="CBO Name" value={formData.name} onChange={handleChange} />
          <input type="text" name="shortname" placeholder="Shortname" value={formData.shortname} onChange={handleChange} />
          <input type="text" name="address" placeholder="Address" value={formData.address} onChange={handleChange} />
          <button onClick={handleNext}>Next</button>
        </div>
      )}

      {step === 2 && (
        <div>
          <h2>Step 2: Additional Details</h2>
          <input type="number" name="number_of_members" placeholder="Number of Members" value={formData.number_of_members} onChange={handleChange} />
          <input type="text" name="contact" placeholder="Contact Information" value={formData.contact} onChange={handleChange} />
          <button onClick={handlePrev}>Prev</button>
          <button onClick={handleNext}>Next</button>
        </div>
      )}

      {step === 3 && (
        <div>
          <h2>Step 3: Mission & Vision</h2>
          <textarea name="mission" placeholder="Mission Statement" value={formData.mission} onChange={handleChange}></textarea>
          <textarea name="vision" placeholder="Vision Statement" value={formData.vision} onChange={handleChange}></textarea>
          <button onClick={handlePrev}>Prev</button>
          <button onClick={handleNext}>Next</button>
        </div>
      )}

      {step === 4 && (
        <div>
          <h2>Step 4: Review & Submit</h2>
          <pre>{JSON.stringify(formData, null, 2)}</pre>
          <button onClick={handlePrev}>Back</button>
          <button onClick={() => alert("Submitted!")}>Confirm</button>
        </div>
      )}
    </div>
  );
};

export default Register;
